import unittest
import unittest

from anagram import isAnagram

class AnagramTest(unittest.TestCase):
    def test_anagram(self):
        self.assertEqual(isAnagram('anagram', 'nagaram'), True)
    
    def test_rat(self):
        self.assertEqual(isAnagram('rat', 'car'), False)

    def test_a(self):
        self.assertEqual(isAnagram('a', 'ab'), False)

    def test_ab(self):
        self.assertEqual(isAnagram('ab', 'a'), False)

    def test_long_test(self):
        s = ""
        t = ""
        self.assertEqual(isAnagram(s, t), True)

if __name__ == '__main__':
    unittest.main()
